"    <div id=\"calc_hints\">",
"     <span class=\"medCalcFontOneBold\">",
"      Notes",
"     </span>",
"     <ul class=\"medCalcFontOne\">",
"      <li>",
"       <b>",
"        Low Risk",
"       </b>",
"       (0-7 points) You probably do not have a problem with alcohol. Continue drinking in moderation or not at all.",
"      </li>",
"      <li>",
"       <b>",
"        Medium Risk",
"       </b>",
"       (8-15 points) You may drink too much on occasion. This may put you or others at risk. Try to cut down on alcohol or stop drinking completely.",
"      </li>",
"      <li>",
"       <b>",
"        High Risk",
"       </b>",
"       (16-19 points) Your drinking could lead to harm, if it hasn't already. It's important that you cut down on alcohol or stop drinking completely. Ask your doctor or nurse for advice on how best to cut down.",
"      </li>",
"      <li>",
"       <b>",
"        Addiction Likely",
"       </b>",
"       (20+ points) It is likely that your drinking is causing harm. Speak to your doctor or nurse, or an addiction specialist. Ask about medications and counseling that can help you stop drinking. If you are dependent on alcohol, do not stop drinking without the help of a healthcare professional.",
"      </li>",
"     </ul>",
