"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    TNM staging system for colorectal cancer, 6th edition",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Primary tumor (T)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tis",
"       </td>",
"       <td colspan=\"3\">",
"        Carcinoma in situ; intraepithelial (within glandular basement membrane) or invasion of lamina propria (intramucosal)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T1",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades submucosa",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades muscularis propria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T3",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor invades through the muscularis propria into the subserosa, or into non-peritonealized pericolic or perirectal tissues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T4",
"       </td>",
"       <td colspan=\"3\">",
"        Tumor directly invades other organs or structures, and/or perforates visceral peritoneum&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Regional lymph node (N)&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        NX",
"       </td>",
"       <td colspan=\"3\">",
"        Regional nodes cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N0",
"       </td>",
"       <td colspan=\"3\">",
"        No regional nodal metastases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N1",
"       </td>",
"       <td colspan=\"3\">",
"        Metastasis in 1 to 3 regional lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        N2",
"       </td>",
"       <td colspan=\"3\">",
"        Metastasis in 4 or more regional lymph nodes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Distant metastasis (M)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MX",
"       </td>",
"       <td colspan=\"3\">",
"        Distant metastasis cannot be assessed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M0",
"       </td>",
"       <td colspan=\"3\">",
"        No distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        M1",
"       </td>",
"       <td colspan=\"3\">",
"        Distant metastasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Stage groupings&loz;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage 0",
"       </td>",
"       <td>",
"        Tis",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage I",
"       </td>",
"       <td>",
"        T1-2",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage IIA",
"       </td>",
"       <td>",
"        T3",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage IIB",
"       </td>",
"       <td>",
"        T4",
"       </td>",
"       <td>",
"        N0",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage IIIA",
"       </td>",
"       <td>",
"        T1-2",
"       </td>",
"       <td>",
"        N1",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage IIIB",
"       </td>",
"       <td>",
"        T3-4",
"       </td>",
"       <td>",
"        N1",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage IIIC",
"       </td>",
"       <td>",
"        Any T",
"       </td>",
"       <td>",
"        N2",
"       </td>",
"       <td>",
"        M0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"\">",
"        Stage IV",
"       </td>",
"       <td>",
"        Any T",
"       </td>",
"       <td>",
"        Any N",
"       </td>",
"       <td>",
"        M1",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The completeness of resection of the primary tumor should be reflected by designation of the radial margin status (the surgically dissected surface adjacent to the deepest point of tumor invasion beyond the wall of the large bowel). R0: complete tumor resection, with all margins negative; R1: incomplete tumor resection with microscopic margin involvement; R2: incomplete tumor resection with gross residual tumor that was not resected.",
"     <br>",
"      &bull; Direct invasion in T4 includes invasion of other segments of the colorectum by way of the serosa. Tumor that is adherent to other organs or structures, macroscopically, is classified T4. However, if no tumor is present in the adhesion, the classification should be pT3. V and L substaging should used to denote the presence or absence of vascular or lymphatic invasion.",
"      <br>",
"       &Delta; A tumor nodule in the pericolorectal adipose tissue of a primary carcinoma without histologic evidence of residual lymph node in the nodule is classified as a regional nodal metastasis if the nodule has the form and smooth contour of a lymph node. If it has an irregular contour, it should be classified in the T category, and also coded as V1 (microscopic venous invasion) or V2 (if it was grossly evident), because of the strong likelihood that it represents venous invasion.",
"       <br>",
"        &loz; The y prefix is used for those cancers that are classified following treatment, whereas the r prefix is used for recurrent cancers.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
